<p>将两张网卡绑定，共用一个IP，实现冗余效果。实际上Linux双网卡的绑定模式有7种，而在这里常用的是active-backup，一个设备如果只有一个网卡，那么当这个网卡损坏时设备的网络就会瘫痪。绑定接口的作用就是让多个物理网卡服务于一个IP地址，使得这个网络的抵抗性强。一个设备只能有一个bound接口，配置好以后每个网卡需要一根网线，需要插两个网线，交换机也需要做链路聚合。</p>
